#include "./lttools.cpp"

class Solution {
public:
	unordered_map<int, bool> m;
	bool dfs(const string& s, const int minJump, const int maxJump, int i) {
		if (i >= s.size()-1)
			return true;
		
		if (m.count(i) > 0) {
			return m[i];
		}
		
		for (int j=i+minJump; j<=i+maxJump && j<s.size(); ++j) {
			if (s[j] == '0') {
				bool res = dfs(s, minJump, maxJump, j);
				if (res) {
					m[j] = true;
					return true;
				}
			}
		}
		
		m[i] = false;
		return false;
	}
	
	bool canReach(string s, int minJump, int maxJump) {
		if (s.back() != '0' || s.front() != '0')
			return false;
		
		if (s.size() < minJump)
			return false;
		
		if (s.size() <= maxJump) 
			return true;
		
		vector<int> f(s.size(), 0), sufix(s.size(), 0);
		
		f[s.size()-1] = 1;
		sufix[s.size()-1] = 1;
		for (int i=s.size()-1-minJump; i<s.size(); ++i) {
			sufix[i] = 1;
		}
		for (int i=s.size()-1-minJump; i>=0; --i) {
			if (s[i] == '0') {
				int r = i+maxJump;
				int l = i+minJump;
				int d = sufix[l] - (r >= s.size() ? 0 : (sufix[r] - f[r]));
				if (d != 0) {
					f[i] = 1;
				}
			}
			sufix[i] = sufix[i+1] + f[i];
		}
		return f[0];
//		return dfs(s, minJump, maxJump, 0);
	}
};

int main(int argc, char *argv[]) {
	auto t = LT::Tester(&Solution::canReach);
	t.test("00", 1, 1).equals(true);
	t.test("011101101110", 3, 4).equals(true);
	t.test("011010", 2, 3).equals(true);
	t.test("01101110", 2, 3).equals(false);
	t.test("000100100010", 1, 2).equals(true);
	t.test("",1,49999).equals(false);
}